class DataUser:
    def __init__(self, username):
        self.username = username
        self.data_store = {}

    def process_deletion(self, date):
        if date in self.data_store:
            del self.data_store[date]
            return f"Data for {date} deleted successfully."
        else:
            return f"No data found for {date}."


class UIDesigner:
    def __init__(self, username):
        self.username = username
        self.user_testing_results = []
        self.resources_redesign_status = "Pending"
        self.dabs_round = 1
        self.homepage_round = 1
        self.help_page_round = 3
        self.tech_thursday_issues = []

    def redesign_resources_page(self):
        self.resources_redesign_status = "Completed"
        return "Resources page redesigned successfully."

    def report_user_testing_results(self, agency):
        report = f"User testing results reported to {agency}."
        self.user_testing_results.append(report)
        return report

    def move_to_round(self, project, round_number):
        if project == "DABS or FABS":
            self.dabs_round = round_number
            return f"Moved to round {round_number} of DABS or FABS landing page edits."
        elif project == "Homepage":
            self.homepage_round = round_number
            return f"Moved to round {round_number} of Homepage edits."
        elif project == "Help page":
            self.help_page_round = round_number
            return f"Moved to round {round_number} of Help page edits."
        else:
            return "Project not recognized."

    def track_tech_thursday_issues(self, issue):
        self.tech_thursday_issues.append(issue)
        return f"Issue tracked: {issue}"


class Developer:
    def __init__(self, username):
        self.username = username
        self.issues_log = []
        self.submission_status = {}

    def log_issue(self, issue):
        self.issues_log.append(issue)
        return f"Issue logged: {issue}"

    def modify_submission_status(self, submission_id, status):
        self.submission_status[submission_id] = status
        return f"Submission {submission_id} status updated to {status}."

    def prevent_double_publishing(self, submission_id):
        if submission_id in self.submission_status:
            return "Submission already published."
        else:
            self.submission_status[submission_id] = "Published"
            return f"Submission {submission_id} published successfully."

    def update_validation_rules(self, new_rules):
        # Assuming new_rules is a dictionary of field: rule pairs
        self.validation_rules = new_rules
        return "Validation rules updated successfully."

    def clarify_cfda_error_code_triggers(self, error_code):
        # Simplified error code clarification
        error_triggers = {
            "1001": "Invalid format",
            "1002": "Missing field",
        }
        return error_triggers.get(error_code, "Unknown CFDA error code.")


