class SubmissionDashboardUser:
    def __init__(self, username):
        self.username = username
        self.submissions = {}

    def add_new_submission(self, submission_id, details):
        self.submissions[submission_id] = details
        return f"New submission added: {submission_id}"

    def display_submission_status(self):
        return {submission_id: details for submission_id, details in self.submissions.items()}
